import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Trash2, PlusCircle } from 'lucide-react';

const API_URL = process.env.REACT_APP_API_URL || "http://localhost:5000";

const Dashboard = () => {
  const navigate = useNavigate();

  const [authUser, setAuthUser] = useState(null);
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);

  // ========================================
// CARREGA DADOS DO IMÓVEL PELA ROTA ESPECÍFICA
// ========================================
useEffect(() => {
  if (!authUser) return;

  fetch(`http://localhost:3000/imovel/${id}`)
    .then(res => {
      if (!res.ok) {
        throw new Error('Imóvel não encontrado');
      }
      return res.json();
    })
    .then(property => {
      // Preenche formulário
      setFormData({
        title: property.title,
        description: property.description,
        price: property.price.toString(),
        location: property.location,
        bedrooms: property.bedrooms.toString(),
        bathrooms: property.bathrooms.toString(),
        area: property.area.toString(),
        type: property.type,
        amenities: property.amenities?.join(', ') || '',
        contactName: property.contact?.name || '',
        contactPhone: property.contact?.phone || '',
        contactEmail: property.contact?.email || ''
      });

      // Carrega imagens existentes
      setUploadedImages(property.images || []);
      setLoading(false);
    })
    .catch(error => {
      console.error('Erro ao carregar imóvel:', error);
      alert("Erro ao carregar imóvel");
      navigate("/dashboard");
    });
}, [id, navigate, authUser]);


  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Painel de Gerenciamento</h1>

      <p style={styles.subtitle}>
        Olá, {authUser?.name}! Aqui você encontra todos os imóveis cadastrados.
      </p>

      <button onClick={goToNewProperty} style={styles.addButton}>
        <PlusCircle size={20} />
        Cadastrar Novo Imóvel
      </button>

      <div style={styles.grid}>
        {properties.length === 0 && (
          <p style={styles.empty}>Nenhum imóvel cadastrado ainda.</p>
        )}

        {properties.map((p) => (
          <div key={p.id} style={styles.card}>
            <img
              src={p.images?.[0] || "https://via.placeholder.com/300"}
              alt={p.title}
              style={styles.image}
            />

            <h3 style={styles.cardTitle}>{p.title}</h3>
            <p style={styles.cardInfo}>{p.location}</p>
            <p style={styles.cardPrice}>R$ {p.price}</p>

            <div style={styles.buttonRow}>
              <button
                onClick={() => navigate(`/editar/${p.id}`)}
                style={styles.editButton}
              >
                ✏️ Editar
              </button>

              <button
                onClick={() => deleteProperty(p.id)}
                style={styles.deleteButton}
              >
                <Trash2 size={18} /> Remover
              </button>
            </div>

          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;

/* =======================
        ESTILOS
======================= */

