    objectFit: "cover",
    borderRadius: "6px"
  },
  cardTitle: {
    margin: "0.5rem 0",
    fontSize: "1.1rem",
    fontWeight: "600",
    textAlign: "center"
  },
  cardInfo: {
    color: "#666",
    fontSize: "0.9rem"
  },
  cardPrice: {
    fontWeight: "bold",
    margin: "0.5rem 0"
  },

  buttonRow: {
    display: "flex",
    gap: "0.5rem",
    marginTop: "0.5rem",
    width: "100%",
    justifyContent: "center"
  },

  editButton: {
    background: "#f59e0b",
    color: "white",
    border: "none",
    padding: "0.5rem 1rem",
    borderRadius: "6px",
    cursor: "pointer"
  },

  deleteButton: {
    background: "#dc2626",
    color: "white",
    border: "none",
    padding: "0.5rem 1rem",
    borderRadius: "6px",
    cursor: "pointer",
    display: "flex",
    alignItems: "center",
    gap: "0.3rem"
  },

  addButton: {
    background: "#2563eb",
    color: "white",
    border: "none",
    padding: "0.7rem 1.3rem",
    borderRadius: "8px",
    display: "flex",
    alignItems:"center",
    gap: "0.4rem",
    marginBottom: "2rem",
    cursor: "pointer"
  },

  loadingBox: {
    marginTop: "5rem",
    textAlign: "center"
  },
  loader: {
    width: "40px",
    height: "40px",
    border: "5px solid #ddd",
    borderTop: "5px solid #2563eb",
    borderRadius: "50%",
    margin: "auto",
    animation: "spin 1s linear infinite"
  }
};
